import React from "react";
import hologram from "../img/hologram.png";

export default function BackPreview() {
	return (
		<>
			<div className="back-preview">
				<div className="back-ele back-ele-contact">Customer Care Contact</div>

				<div className="back-ele back-ele-tape">Black tape</div>

				<div className="back-ele cvv-div">
					<div className=" back-ele-hologram"><img src="" alt="" srcset="" /></div>
					<div className="back-ele-cvv">CVV</div>
				</div>
			</div>
		</>
	);
}
